// ==UserScript==
// @name         DH3 Audio Alerts
// @namespace    com.anwinity.dh3
// @version      1.1.7
// @description  Trigger audible alerts based on dh3 variables.
// @author       Anwinity
// @match        dh3.diamondhunt.co
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/413409/DH3%20Audio%20Alerts.user.js
// @updateURL https://update.greasyfork.org/scripts/413409/DH3%20Audio%20Alerts.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const TTS_AVAILABLE = !!(window.speechSynthesis);
    const ding = new Audio("data:audio/wav;base64,");
    const sounds = { ding: ding };
    let alerts = [];
    let alertPrevValues = [];
    let voices;
    let voice = null;
    let volume = 1;

    function playAlert(alert) {
        if($("#dh3-audio-alerts-mute").prop("checked")) {
           return;
        }
        if(alert.type == "sound") {
            playSound(alert.data);
        }
        else if(alert.type == "tts") {
            playTTS(alert.data);
        }
    }

    function playSound(uri) {
        uri = uri || "ding";
        let sound = sounds[uri];
        if(sound) {
            sound.volume = volume/100;
            sound.play();
        }
    }

    function preloadSound(uri) {
        if(uri) {
            let sound = sounds[uri];
            if(!sound) {
                sounds[uri] = new Audio(uri);
            }
        }
    }

    function playTTS(text) {
        if(TTS_AVAILABLE && text) {
            let message = new SpeechSynthesisUtterance();
            message.text = text;
            if(voice) {
                message.voice = voice;
            }
            message.volume = volume/100;
            window.speechSynthesis.speak(message);
        }
    }

    function findVoice(uri) {
        if(TTS_AVAILABLE) {
            if(!voices || voices.length == 0) {
                voices = window.speechSynthesis.getVoices();
            }
            let found = voices.find(v => v.voiceURI == uri);
            if(!found) {
                found = voices.find(v => v.default);
            }
            if(!found && voices.length>0) {
                found = voices[0];
            }
            return found;
        }
    }

    function loadAlerts() {
        let key = `dh3-audio-alerts-${window.var_username}`;
        let item = localStorage.getItem(key);
        alerts = []; // default empty config
        alertPrevValues = [];
        if(item) {
            try {
                alerts = JSON.parse(item);
            }
            catch(err) {
                log.error("Failed to load DH3 Audio Alerts data - it may be corrupt.");
            }
        }
        alerts.forEach(alert => {
            if(alert.enabled !== false) {
                alert.enabled = true;
            }
            if(alert.type == "sound") {
                preloadSound(alert.data);
            }
            alertPrevValues.push("");
        });
    }

    function saveAlerts() {
        let key = `dh3-audio-alerts-${window.var_username}`;
        alerts.filter(alert => alert.triggerCondition=="eval").forEach(alert => alert.triggerVariable = "");
        localStorage.setItem(key, JSON.stringify(alerts));
        alerts.forEach(alert => {
            if(alert.type == "sound") {
                preloadSound(alert.data);
            }
        });
    }

    function loadVoice() {
        if(!TTS_AVAILABLE) {
            return;
        }
        let key = "dh3-audio-alerts-voice";
        let voiceURI = localStorage.getItem(key);
        voice = findVoice(voiceURI);
        let el = $("#dh3-audio-alerts-voice-select");
        voices.forEach(function(v) {
            el.append(`<option value="${v.voiceURI}">${v.name}</option>`);
        });
        el.val(voice.voiceURI);
    }

    function saveVoice() {
        let key = "dh3-audio-alerts-voice";
        if(voice) {
            localStorage.setItem(key, voice.voiceURI);
        }
    }

    function loadVolume() {
        let key = "dh3-audio-alerts-volume";
        let vol = localStorage.getItem(key) || "100";
        try {
            vol = parseInt(vol);
        }
        catch(err) {
            vol = 100;
        }
        volume = vol;
    }

    function saveVolume(vol) {
        let key = "dh3-audio-alerts-volume";
        volume = vol;
        localStorage.setItem(key, vol);
    }

    function blink(id, color, dur1, dur2) {
        if(typeof dur2 !== "number") {
            dur1 /= 2;
            dur2 = dur1;
        }
        let el = $(`#${id}`);
        if(el.is(":animated")) {
            return;
        }
        let bg = el.css("background-color");
        el.animate({"background-color": color}, dur1, function() {
            el.animate({"background-color": bg}, dur2);
        });
    }

    function blinkNav() {
        blink("navigation-dh3-audio-alerts-button", "#7C2F00", 500);
    }

    function blinkSave() {
        blink("dh3-audio-alerts-save-button", "green", 20, 400);
    }

    function applyAlertsToUI(alerts) {
        $(".dh3-audio-alerts-alert-row").remove();
        alerts.forEach(addAlertRow);
    }

    function buildAlertsFromUI() {
        let result = [];
        $(".dh3-audio-alerts-alert-row").each(function() {
            let row = $(this);
            let type = row.find(".dh3-audio-alerts-type").val();
            let data = row.find(".dh3-audio-alerts-data").val();
            let triggerVariable = row.find(".dh3-audio-alerts-trigger-variable").val();
            let triggerCondition = row.find(".dh3-audio-alerts-trigger-condition").val();
            let triggerValue = row.find(".dh3-audio-alerts-trigger-value").val();
            let enabled = row.find(".dh3-audio-alerts-enabled").prop("checked");
            result.push({
                type: type,
                data: data,
                triggerVariable: triggerVariable,
                triggerCondition: triggerCondition,
                triggerValue: triggerValue,
                enabled: enabled
            });
        });
        return result;
    }

    function testTrigger(value, condition, triggerValue) {
        switch(condition) {
            case "lt": {
                value = parseFloat(value);
                triggerValue = parseFloat(triggerValue);
                return value < triggerValue;
            }
            case "le": {
                value = parseFloat(value);
                triggerValue = parseFloat(triggerValue);
                return value <= triggerValue;
            }
            case "gt": {
                value = parseFloat(value);
                triggerValue = parseFloat(triggerValue);
                return value > triggerValue;
            }
            case "ge": {
                value = parseFloat(value);
                triggerValue = parseFloat(triggerValue);
                return value >= triggerValue;
            }
            case "eq": {
                return value == triggerValue;
            }
            case "ne": {
                return value != triggerValue;
            }
            case "reg": {
                let regex = new RegExp(triggerValue, "i");
                return value.match(regex);
            }
            case "nreg": {
                let regex = new RegExp(triggerValue, "i");
                return !value.match(regex);
            }
            case "eval": {
                return !!eval(triggerValue);
            }
        }
        return false;
    }

    function initUI() {
        const styles = document.createElement("style");
        styles.textContent = `
        table#dh3-audio-alerts-table {
          border-collapse: collapse;
          width: 100%;
        }
        table#dh3-audio-alerts-table tr, table#dh3-audio-alerts-table th, table#dh3-audio-alerts-table td {
          border: 1px solid rgb(50, 50, 50);
          background-color: rgba(26, 26, 26, 0.6);
          text-align: left;
        }
        table#dh3-audio-alerts-table th {
          padding-left: 0.25em;
          padding-right: 0.25em;
        }
        table#dh3-audio-alerts-tablee th, table#dh3-audio-alerts-table td {
          padding: 0.25em;
        }
        .dh3-audio-alerts-input {
          display: inline-block;
          background-color: rgb(26, 26, 26);
          color: white;
          border: 1px solid rgb(64, 64, 64);
        }
        .dh3-audio-alerts-input:disabled {
          color: #999999;
        }
        button.dh3-audio-alerts-input:disabled {
          cursor: default;
        }
        .dh3-audio-alerts-input.w-100 {
          width: 100%;
        }
        .dh3-audio-alerts-input[type="range"] {
          -webkit-appearance: none;
          height: 18px;
          background: rgb(26, 26, 26);
          outline: none;
          opacity: 0.7;
          -webkit-transition: .2s;
          transition: opacity .2s;
        }
        .dh3-audio-alerts-input[type="range"]:hover {
          opacity: 1;
        }
        .dh3-audio-alerts-input[type="range"]::-webkit-slider-thumb {
          -webkit-appearance: none;
          appearance: none;
          width: 16px;
          height: 18px;
          background: rgb(64, 64, 64);
          cursor: pointer;
        }
        .dh3-audio-alerts-input[type="range"]::-moz-range-thumb {
          width: 16px;
          height: 18px;
          background: rgb(64, 64, 64);
          cursor: pointer;
        }
        button.dh3-audio-alerts-table-button {
          cursor: pointer;
        }
        .dh3-audio-alerts-current-value {
          font-family: "Lucida Console", Monaco, monospace;
        }
        .dh3-audio-alerts-flex-wrapper {
          display: flex;
          width: 100%;
          padding: 0;
          margin: 0;
        }
        .dh3-audio-alerts-flex-wrapper > .dh3-audio-alerts-flex-item {
          flex-basis: 100%;
        }
        .dh3-audio-alerts-flex-wrapper > .dh3-audio-alerts-flex-item:not(:first-child) {
          margin-left: 0.125em;
        }
        .dh3-audio-alerts-flex-wrapper > .dh3-audio-alerts-flex-item:not(:last-child) {
          margin-right: 0.125em;
        }
        .dh3-audio-alerts-code {
          font-family: "Lucida Console", Monaco, monospace;
          color: #DAFFCC;
          background-color: rgba(128,128,128,0.25)
        }
        .dh3-audio-alerts-blue {
          color: rgb(0, 172, 230);
        }
        `;
        $("head").append(styles);

        $("#navigation-area-buttons").append(`
        <div onclick="navigate('dh3-audio-alerts')" id="navigation-dh3-audio-alerts-button" class="navigate-button" style="color: white;">
          <div style="color: red; text-align: center; height: 50px; width: 50px; font-size: 46px">!</div>
          <div style="font-size: 10pt; text-align: center;">Alerts</div>
        </div>
        `);

        $("#right-panel").append(`
        <div id="navigation-dh3-audio-alerts" style="display: none; padding: 1em;">
          <p>Add alerts below to trigger sounds or voice to be played once the condition is met. If you are not sure what to use for the variable, feel free to ask me (or other people in chat). When a condition changes from not met to met, the sound will be played. The Alerts tab will flash as long as at least one alert's condition is met. Changes in the table below will not take effect until you click save.</p>
          <p>
             The RegEx and Eval trigger options are for more advanced users who wish to implement more complicated logic for their alerts.
             The RegEx options will match the variable value against a provided regular expression <span class="dh3-audio-alerts-code">new RegExp(<span class="dh3-audio-alerts-blue">value</span>, "i")</span>
             where <span class="dh3-audio-alerts-code dh3-audio-alerts-blue">value</span> is the value of the associated text field.
             Similarly, Eval will execute javascript using <span class="dh3-audio-alerts-code">eval(<span class="dh3-audio-alerts-blue">value</span>)</span>. Any non-falsy value will trigger the alert. The variable field is not used for eval.
          </p>
          <br /><br />
          <table id="dh3-audio-alerts-table">
            <thead>
              <tr>
                <th width="8%">Enabled</th>
                <th width="17%">Variable</th>
                <th width="15%">Trigger</th>
                <th width="15%">Current Value</th>
                <th width="15%">Type</th>
                <th width="20%">Options</th>
                <th width="10%"></th>
              </tr>
            </thead>
            <tbody>
              <tr id="dh3-audio-alerts-add-alert-row">
                <td colspan="2">
                  <select id="dh3-audio-alerts-voice-select" class="dh3-audio-alerts-input w-100" ${TTS_AVAILABLE?"":"disabled"}>
                    <option disabled>${TTS_AVAILABLE?"Select Voice":"Voice Not Supported"}</option>
                  </select>
                </td>
                <td>
                  <input id="dh3-audio-alerts-mute" type="checkbox" class="dh3-audio-alerts-input"><label for="dh3-audio-alerts-mute">Mute all alerts</label>
                </td>
                <td colspan="2">
                  <div>
                    Volume:&nbsp;
                    <input type="range" min="0" max="100" value="50" class="dh3-audio-alerts-input" id="dh3-audio-alerts-volume">
                    &nbsp;<span id="dh3-audio-alerts-volume-label">50%</span>
                  </div>
                </td>
                <td>
                  <div class="dh3-audio-alerts-flex-wrapper">
                    <button id="dh3-audio-alerts-revert-button" type="button" class="dh3-audio-alerts-input dh3-audio-alerts-table-button dh3-audio-alerts-flex-item">Revert</button>
                    <button id="dh3-audio-alerts-save-button" type="button" class="dh3-audio-alerts-input dh3-audio-alerts-table-button dh3-audio-alerts-flex-item" disabled>Save</button>
                  </div>
                </td>
                <td>
                  <button id="dh3-audio-alerts-add-button" type="button" class="dh3-audio-alerts-input dh3-audio-alerts-table-button w-100">Add</button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>
        `);
        $("#dh3-audio-alerts-voice-select").change(function() {
            voice = findVoice($(this).val());
            saveVoice();
        });
        $("#dh3-audio-alerts-add-button").click(() => addAlertRow());
        $("#dh3-audio-alerts-save-button").click(function() {
            alerts = buildAlertsFromUI();
            saveAlerts();
            alertPrevValues = [];
            alerts.forEach(() => alertPrevValues.push(""));
            // blinkSave();
            $("#dh3-audio-alerts-save-button").prop("disabled", true);
        });
        $("#dh3-audio-alerts-revert-button").click(function() {
            applyAlertsToUI(alerts);
            $("#dh3-audio-alerts-save-button").prop("disabled", true);
        });
        $("#dh3-audio-alerts-volume").change(function() {
            let vol = parseInt($(this).val());
            saveVolume(vol);
        });
        $("#dh3-audio-alerts-volume").on("input", function() {
            let vol = $(this).val();
            $("#dh3-audio-alerts-volume-label").text(vol+"%");
        });

        const originalNavigate = window.navigate;
        window.navigate = function(a) {
            originalNavigate.apply(this, arguments);
            if(a=="dh3-audio-alerts") {
                //
            }
            else {
                $("#navigation-dh3-audio-alerts").hide();
            }
        };

        const originalSetItems = window.setItems;
        window.setItems = function() {
            originalSetItems.apply(this, arguments);
            // update table (alerts in table may differ from saved alerts)
            $(".dh3-audio-alerts-alert-row").each(function() {
                let row = $(this);
                let varName = row.find(".dh3-audio-alerts-trigger-variable").val();
                let varValue = varName ? window[varName] : "";
                let triggerCondition = row.find(".dh3-audio-alerts-trigger-condition").val();
                let triggerValue = row.find(".dh3-audio-alerts-trigger-value").val();
                let valueElement = row.find(".dh3-audio-alerts-current-value");
                valueElement.text(`${varValue}`);
                try {
                    let triggered = testTrigger(varValue, triggerCondition, triggerValue);
                    if(triggerCondition == "eval") {
                        valueElement.text(triggered);
                    }
                    valueElement.css("color", triggered ? "red" : "white");
                }
                catch(err) {
                    valueElement.text("ERROR");
                    valueElement.css("color", "yellow");
                }
            });

            // process saved alerts
            let anyTriggered = false;
            for(let i = 0; i < alerts.length; i++) {
                try {
                    let alert = alerts[i];
                    let previous = alertPrevValues[i];
                    let current = window[alert.triggerVariable];
                    let condition = alert.triggerCondition;
                    let value = alert.triggerValue;
                    if(condition != "eval") {
                        alertPrevValues[i] = current;
                    }
                    let previousTrigger = false, currentTrigger = false;

                    try {
                        if(condition == "eval") {
                            previousTrigger = alertPrevValues[i];
                        }
                        else {
                            previousTrigger = testTrigger(previous, condition, value);
                        }
                    }
                    catch(err) {
                        console.error("DH3 Audio Alerts - alert threw an error for previous tick.", err);
                    }
                    try {
                        currentTrigger = testTrigger(current, condition, value);
                        if(condition == "eval") {
                            alertPrevValues[i] = currentTrigger;
                        }
                    }
                    catch(err) {
                        console.error("DH3 Audio Alerts - alert threw an error for current tick.", err);
                    }

                    if(alert.enabled && currentTrigger) {
                        anyTriggered = true;
                        if(!previousTrigger) {
                            playAlert(alert);
                        }
                    }
                }
                catch(err) {
                    log.error("Error processing alert.", err);
                }
            }
            if(anyTriggered) {
                blinkNav();
            }
        }
    }

    function addAlertRow(alert) {
        const soundOptionsPlaceholder = "URL of sound (or blank for default)";
        const ttsOptionsPlaceholder = "Message to be spoken";
        $("#dh3-audio-alerts-add-alert-row").before(`
        <tr class="dh3-audio-alerts-alert-row">
          <td>
            <input type="checkbox" class="dh3-audio-alerts-input dh3-audio-alerts-enabled" checked>
          </td>
          <td>
            <input class="dh3-audio-alerts-input dh3-audio-alerts-trigger-variable w-100" placeholder="var_whatever">
          </td>
          <td>
            <div class="dh3-audio-alerts-flex-wrapper">
              <select class="dh3-audio-alerts-input dh3-audio-alerts-trigger-condition dh3-audio-alerts-flex-item">
                <option value="lt" selected>&lt;</option>
                <option value="le" selected>&#8804;</option>
                <option value="gt">&gt;</option>
                <option value="ge">&#8805;</option>
                <option value="eq">&equals;</option>
                <option value="ne">&ne;</option>
                <option value="reg">RegEx Match</option>
                <option value="nreg">RegEx Not Match</option>
                <option value="eval">Eval</option>
              </select>
              <input class="dh3-audio-alerts-input dh3-audio-alerts-trigger-value dh3-audio-alerts-flex-item" placeholder="trigger value">
            </div>
          </td>
          <td>
            <span class="dh3-audio-alerts-current-value"></span>
          </td>
          <td>
            <select class="dh3-audio-alerts-input dh3-audio-alerts-type w-100">
              <option value="sound" selected>Audio File</option>
              <option value="tts" ${TTS_AVAILABLE?"":"disabled"}>Text To Speech</option>
            </select>
          </td>
          <td>
            <input class="dh3-audio-alerts-input dh3-audio-alerts-data w-100" placeholder="${!alert || alert.type=='sound' ? soundOptionsPlaceholder : ttsOptionsPlaceholder}">
          </td>
          <td>
            <button type="button" class="dh3-audio-alerts-input dh3-audio-alerts-table-button dh3-audio-alerts-delete-button" style="width: 100%">Delete</button>
          </td>
        </tr>
        `);
        let row =  $(".dh3-audio-alerts-alert-row").last();
        row.find(".dh3-audio-alerts-delete-button").click(function(e) {
            $(this).closest(".dh3-audio-alerts-alert-row").remove();
            $("#dh3-audio-alerts-save-button").prop("disabled", false);
        });
        row.find(".dh3-audio-alerts-trigger-condition").change(function() {
            let condition = $(this).val();
            if(condition == "eval") {
                row.find(".dh3-audio-alerts-trigger-variable").prop("disabled", true);
            }
            else {
                row.find(".dh3-audio-alerts-trigger-variable").prop("disabled", false);
            }
        });
        row.find(".dh3-audio-alerts-type").change(function() {
            let type = $(this).val();
            let dataInput = $(this).closest(".dh3-audio-alerts-alert-row").find(".dh3-audio-alerts-data");
            switch(type) {
                case "sound": {
                    dataInput.attr("placeholder", soundOptionsPlaceholder);
                    break;
                }
                case "tts": {
                    dataInput.attr("placeholder", ttsOptionsPlaceholder);
                    break;
                }
            }
        });
        row.find("select, input").change(function() {
            $("#dh3-audio-alerts-save-button").prop("disabled", false);
        });
        if(alert) {
            row.find(".dh3-audio-alerts-trigger-variable").val(alert.triggerVariable);
            row.find(".dh3-audio-alerts-trigger-condition").val(alert.triggerCondition);
            row.find(".dh3-audio-alerts-trigger-value").val(alert.triggerValue);
            row.find(".dh3-audio-alerts-type").val(alert.type);
            row.find(".dh3-audio-alerts-data").val(alert.data);
            row.find(".dh3-audio-alerts-enabled").prop("checked", !!(alert.enabled));
        }
    }

    function init() {
        if(!window.var_username) {
            window.speechSynthesis.getVoices();
            setTimeout(init, 1000);
            return;
        }
        if(TTS_AVAILABLE) {
            let voices = window.speechSynthesis.getVoices();
            setTimeout(function() {
                if(!voices || voices.length == 0) {
                    voices = window.speechSynthesis.getVoices();
                }
                loadVoice();
            }, 4000);
        }
        loadVolume();
        loadAlerts();
        initUI();
        applyAlertsToUI(alerts);
    }

    if(TTS_AVAILABLE) {
        // seems to take a little time to load so getVoices() may initially return an empty array
        // call it as early as possible to decrease the chance of missing the values...
        window.speechSynthesis.getVoices();
    }
    $(init);

})();